import React from "react";

const SlidingMenu = ({ isOpen, onClose }) => {
  return (
    <div className={`sliding-menu ${isOpen ? "open" : ""}`}>
      {/* Content of the menu */}
      <div className="close-button" onClick={onClose}>
        X
      </div>
      <div className="side-menu-container">
        <div className="each-menu">Entities Index</div>
        <div className="each-menu">Workforce index</div>
        <div className="each-menu">Digital skills Historical Scoring</div>
      </div>

      {/* Close button */}
    </div>
  );
};

export default SlidingMenu;
